var pdfMake = require('pdfmake/build/pdfmake.js');
var pdfFonts = require('pdfmake/build/vfs_fonts.js');
pdfMake.vfs = pdfFonts.pdfMake.vfs;

export default {
  methods: {
    buildPdfReport(data, labels, columns, widths, title, date, valor)
    {
      // Data de Hoje
      //var date = new Date();
      var dia=date.substring(8, 10);
      var mes=date.substring(5, 7);
      var ano=date.substring(0, 4);
      date = dia + '/' + (mes) + '/' + ano;

      // constrói o relatório
      var doc = {
        footer: function() {
          return {
            margin:10,
            columns: [
              {
                fontSize: 9,
                text:[
                  {
                    text: '' +
                    '\n',
                    margin: [0, 20]
                  },
                  {
                    text: "IFCE",
                  }
                ],
                alignment: 'center'
              }
            ]
          };

        },
        content: [],
        styles: {
          header: {
            fontSize: 18,
            bold: true,
            alignment: 'center'
          },
          anotherStyle: {
            italics: true,
            alignment: 'right'
          },
          alignLeft: {
            alignment: 'center'
          }
        }
      };

      // Adiciona uma imagem ao documento
      doc.content.push(    {
        width: 50,
        height: 50,
        alignment: 'center',
        image: 'data:image/png;base64,'

      },);


      doc.content.push({text: '\nInstituto Federal do Ceará\n\n', style: 'alignLeft' });
      doc.content.push({text: date + '\n\n', style: 'alignLeft' });
      doc.content.push({text: title + '\n\n', style: 'header' });
      doc.content.push({text: 'Valor total: ' + valor + ' R$' + '\n\n', style: 'alignLeft' });
  
      var data_table = {
        layout: 'lightHorizontalLines', // optional
        table: {
          headerRows: 1,
          widths: widths,
          body: []
        }
      };

      // Legendas da Tabela
      var line = []
      for(var i = 0; i < labels.length;i++)
      {
        line.push({ text: labels[i], bold: true });
      }
      data_table.table.body.push(line);

      // Linhas da Tabela
      for(var i = 0; i < data.length;i++)
      {
        var row = [];
        for(var j = 0; j < columns.length;j++)
        {
          row.push(data[i][columns[j]]);
        }
        data_table.table.body.push(row);
      }

      doc.content.push(data_table);
      //doc.content.push({text: '\n\n' + date, style:'alignLeft'});

      pdfMake.createPdf(doc).open();
     // pdfMake.createPdf(doc).print();
      //pdfMake.createPdf(doc).download();
    }
  }
}
